import { Link } from "react-router-dom";

import discover from "../../assets/images/icons/explore.svg";
import plus from "../../assets/images/icons/plus.svg";
import bookmark from "../../assets/images/icons/bookmark.svg";
import settings from "../../assets/images/icons/settings.svg";

const NavBar = () => {
  return (
    <div className="navbar">
      <Link to="/" className="navbar__discover-btn">
        <img src={discover} alt="Explore events" />
        <p>Discover</p>
      </Link>
      <Link to="/create-event" className="navbar__create-event-btn">
        <img src={plus} alt="Create event" />
      </Link>
      <Link to="/favorite-events" className="navbar__favorite-events-btn">
        <img src={bookmark} alt="Favorite events" />
      </Link>
      <Link to="/settings" className="navbar__settings-btn">
        <img src={settings} alt="Settings" />
      </Link>
    </div>
  );
};

export default NavBar;
